import React, { Fragment } from 'react'
import Carousel from '../Componentes/Carousel/Carousel'
import Container from '../Componentes/Container/Container'
import CarouseData from '../API/Carousel.json'

const Home = (Carouselvalue) => {
  return (
    <Fragment>
    <Container value='main-container'>

    {/* {CarouseData.homeCarousel.map((i, j)=>
      <Carousel key={j} value={i}/>
    )} */}

    {/* <Carousel Carouselvalue={CarouseData}/> */}
    {Carouselvalue.homeCarousel.map((item, key) =>
          <img src={item.image} />
      )}
     </Container>
    </Fragment>
  )
}

export default Home
